import { Component } from "./Component";
import { useGlobalContext } from "./context";
import "./index.css";
const AllComponents = () => {
  const { clean } = useGlobalContext();
  return (
    <section>
      <table>
        <tr>
          <th>to do</th>
          <th>doing</th>
          <th>done</th>
        </tr>
        <tr>
          <Component name="todo" />
          <Component name="doing" />
          <Component name="done" />
        </tr>
      </table>
    </section>
  );
};

export default AllComponents;
